import React, { ReactDOM }from 'react'
import {
    BrowserRouter
  }  from 'react-router-dom';

import User from './user/user'
import Film from './film/film'
import Planet from './planet/planet'

export const routes = [
    {
      component: User,
      routes: [
        {
          path: "/",
          exact: true,
          component: User
        },
        {
            path: "/films",
            exact: true,
            component: Film
        },
        {
            path: "/planets",
            exact: true,
            component: Planet
        }
      ]
    }
  ];
